import React from "react";
import { dogs } from "./App";
import Dog from "./Dog";
import {Link} from 'react-router-dom'
function Dogs(){

    {console.log(`this is: ${dogs}`)};
    return(
        <>
        <h1>Our Dogs</h1>
        {dogs.map(d => (
            <>
            <Dog name={d.name} age={d.age} src={d.src} facts={d.facts} />

            <Link to={`/dogs/${d.name.toLowerCase()}`}>{d.name}</Link>
</>
        ))}
        </>
    )
}

export default Dogs;
